<?php

namespace Simtabi\Pheg\Toolbox\Colors\Helpers;

class Palettes
{

    private static $instance = null;
    private static function getInstance(): ?self
    {
        if (!self::$instance) {
            self::$instance = new self();
        }
        return self::$instance;
    }

    public static function invoke(): self
    {
        return self::getInstance();
    }

    /**
     * Returns an array with the color information if the color is found
     * Returns an empty array otherwise
     *
     * @param string $name
     * @param string $index
     * @return array
     */
    public function findByNameFromPalette($name, $index = null)
    {
        $palettes = self::invoke()->getColorPalettes();
        if ($index === null) {
            foreach ($palettes as $colorFamily => $colors) {
                foreach ($colors as $colorName => $colorData) {
                    if ($name == $colorName || $name == $colorData['name'] || $name == $colorData['reference']) {
                        return $colorData;
                    }
                }
            }
        } elseif (array_key_exists($index, $palettes)) {
            foreach ($palettes[$index] as $colorName => $colorData) {
                if ($name == $colorName || $name == $colorData['name'] || $name == $colorData['reference']) {
                    return $colorData;
                }
            }
        }

        return [];
    }

    /**
     * @param string $name
     * @param string $index
     * @return string
     */
    public function findHexByNameFromPalette($name, $index = null)
    {
        $data = $this->findByNameFromPalette($name, $index);

        return $data['hexa'] ?? null;
    }

